import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';

const FinanceDealDetails = () => {
  const { dealId } = useParams();
  const navigate = useNavigate();
  const [documents, setDocuments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    setLoading(true);
    fetch(`/api/deals/${dealId}`, { credentials: 'include' })
      .then(res => {
        if (!res.ok) throw new Error('Deal not found');
        return res.json();
      })
      .then(async data => {
        const deal = data.deal || data.data || data;
        // Try to get the vehicle record by _id first, then by recordId
        let vehicleRecord = null;
        let recordError = null;
        if (deal.vehicleRecordId) {
          // Try fetching by _id
          const resById = await fetch(`/api/documents/vehicle-records/by-id/${deal.vehicleRecordId}`, { credentials: 'include' });
          if (resById.ok) {
            const dataById = await resById.json();
            vehicleRecord = dataById.data || dataById.vehicleRecord || dataById;
          } else {
            recordError = 'Vehicle record not found by ID.';
          }
        }
        if (!vehicleRecord && deal.recordId) {
          // Try fetching by recordId
          const resByRecordId = await fetch(`/api/documents/vehicle-records/${deal.recordId}`, { credentials: 'include' });
          if (resByRecordId.ok) {
            const dataByRecordId = await resByRecordId.json();
            vehicleRecord = dataByRecordId.data || dataByRecordId.vehicleRecord || dataByRecordId;
          } else {
            recordError = 'Vehicle record not found by recordId.';
          }
        }
        if (!vehicleRecord) {
          setError(recordError || 'Vehicle record not found.');
          setDocuments([]);
          setLoading(false);
          return;
        }
        setDocuments(vehicleRecord.generatedDocuments || []);
        setLoading(false);
      })
      .catch(err => {
        setError(err.message);
        setLoading(false);
      });
  }, [dealId]);

  const handleDownload = (fileName) => {
    window.open(`/api/documents/download/${fileName}`, '_blank');
  };

  if (loading) return <div className="p-8 text-white">Loading...</div>;
  if (error) return <div className="p-8 text-red-400">Error: {error}</div>;

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 via-gray-800 to-black p-8">
      <button className="mb-6 flex items-center text-blue-400 hover:text-blue-300 font-medium" onClick={() => navigate(-1)}>
        <svg className="h-5 w-5 mr-2" fill="none" stroke="currentColor" strokeWidth="2" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" d="M15 19l-7-7 7-7" /></svg>
        Back
      </button>
      <h1 className="text-3xl font-bold text-white mb-6">Deal Documents</h1>
      <div className="bg-white/5 rounded-2xl border border-white/10 p-8 shadow-xl max-w-3xl mx-auto">
        {documents.length === 0 ? (
          <div className="text-gray-400">No documents found for this deal.</div>
        ) : (
          <table className="min-w-full divide-y divide-gray-700">
            <thead>
              <tr>
                <th className="px-4 py-2 text-left text-xs font-medium text-gray-400 uppercase">Name</th>
                <th className="px-4 py-2 text-left text-xs font-medium text-gray-400 uppercase">Type</th>
                <th className="px-4 py-2 text-left text-xs font-medium text-gray-400 uppercase">Status</th>
                <th className="px-4 py-2 text-left text-xs font-medium text-gray-400 uppercase">Generated</th>
                <th className="px-4 py-2"></th>
              </tr>
            </thead>
            <tbody className="divide-y divide-gray-800">
              {documents.map((doc, idx) => (
                <tr key={idx}>
                  <td className="px-4 py-2 text-white">{doc.fileName || doc.name || 'Untitled'}</td>
                  <td className="px-4 py-2 text-gray-300">{doc.documentType || doc.type || 'N/A'}</td>
                  <td className="px-4 py-2">
                    <span className={`px-2 py-1 rounded-full text-xs font-semibold ${doc.status === 'approved' ? 'bg-green-500/20 text-green-400' : doc.status === 'pending' ? 'bg-orange-500/20 text-orange-400' : 'bg-gray-500/20 text-gray-400'}`}>
                      {doc.status || (doc.approved ? 'approved' : doc.approved === false ? 'pending' : 'N/A')}
                    </span>
                  </td>
                  <td className="px-4 py-2 text-gray-300">{doc.generatedAt ? new Date(doc.generatedAt).toLocaleDateString() : 'N/A'}</td>
                  <td className="px-4 py-2">
                    <button
                      className="bg-blue-500/20 text-blue-400 hover:bg-blue-500/30 text-xs font-medium py-1 px-3 rounded-lg transition-all duration-300"
                      onClick={() => handleDownload(doc.fileName || doc.name)}
                    >
                      Download
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        )}
      </div>
    </div>
  );
};

export default FinanceDealDetails;
